import React from 'react';

const Header = () => {
  return (
    <header className="header">
      <h1>Welcome to My App</h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
